import React from "react";
import Footer from "./Footer";
import Header from "./Header";
import Note from "./Note";
import notes from "../notes";



function App(){
    return (
        <div>
            <Header />

            {notes.map(function (noteItem){
                return (
                    <Note 
                        key = {noteItem.key}
                        content= {noteItem.content}
                    />
                );
            })}

            <Footer />
        </div>
    );
}

export default App;
